import React, { Component } from "react";
import {
    Card,
    CardImg,
    CardBody,
    CardTitle,
    CardText,
    CardImgOverlay
  } from "reactstrap";

export default class DishDetail extends Component {
    renderDish = (dish) => {
        return (<Card>
            <CardImg src={dish.image} alt={dish.name} />
            <CardBody>
              <CardTitle>{dish.name}</CardTitle>
              <CardText>{dish.description}</CardText>
            </CardBody>
          </Card>)
    }
  render() {

    return (
      <div>
          {this.renderDish}
      </div>

    );
  }
}
